import React from 'react';

function Main(props) {
  return (
    <div>
      <form style={{"display": "flex", "flexDirection": "column", "justifyContent": "center", "alignItems": "center", "margin": "50% 0"}}>
        <img src="https://www.imaswmp.in/wp-content/uploads/default-avatar.jpg" style={{"height": "100px", "borderRadius": "100px"}} alt="image1"/>
        <div style={{"display": "flex", "flexDirection": "column", "justifyContent": "center", "alignItems": "center", "margin": "20px"}}>
        <input placeholder="Username" style={{"marginBottom": "10px"}}/>
        <input placeholder="Password"/>
        </div>
        <div style={{"fontSize": "10px", "display": "flex", }}>
          <p ><input type="checkbox"/>Remember me</p>
          <a href="/">Forgot password?</a>
        </div>
      </form>

    </div>
  );
}

export default Main;
